  return(
    <Fragment>
    <h1>Posts</h1><br/>
    <div className="posts">

      {posts === null ? (<p>Damn!</p>):(
        posts.map(post => (<div key={post._id}>

          <div class="post bg-white p-1 my-1">
       <div>
         <a href="profile.html">
           <img
             class="round-img"
             src="https://www.gravatar.com/avatar/205e460b479e2e5b48aec07710c08d50?s=200"
             alt=""
           />
           <h4>John Doe</h4>
         </a>
       </div>
       <div>
         <p class="my-1">
           Lorem ipsum dolor sit amet consectetur adipisicing elit. Sint
