         </p>
          <p class="post-date">
             Posted on 04/16/2019
         </p>
         </div>
         </div>
          </div>)
      ))}

    </div>
    </Fragment>
  );
}

Posts.propTypes = {
  posts: PropTypes.array.isRequired
};

export default Posts
